import React, { useState } from 'react';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
import AppBar from 'material-ui/AppBar';
const Products= () =>{
    return (
        <MuiThemeProvider>
          <div>
          <AppBar
             title="App Name"
             style={header}
           />
           </div>
           </MuiThemeProvider>
    )
}
const header={
    background:" #878a8a",
    color: rgb(255, 255, 255),
}

export default Products;
